-- ----------------------------
-- Table structure for animal
-- ----------------------------
DROP TABLE IF EXISTS `animal`;
CREATE TABLE `animal` (
  `id` int NOT NULL AUTO_INCREMENT,
  `picture` varchar(255) DEFAULT '',
  `name` varchar(255) NOT NULL DEFAULT '',
  `breed` varchar(255) DEFAULT '',
  `date` varchar(20) DEFAULT '',
  `age` int DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `cid` int DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL COMMENT '0发布未收容，1已收容未领养，2已申请领养未审核，3已领养审核',
  `address` varchar(255) DEFAULT NULL COMMENT '被发现地址\r\n',
  `adoptname` varchar(255) DEFAULT NULL COMMENT '领养用户名',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `fk_cid_areas_on_cid` (`cid`) USING BTREE,
  CONSTRAINT `fk_cid_areas_on_cid` FOREIGN KEY (`cid`) REFERENCES `areas` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=131 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;

