-- ----------------------------
-- Table structure for jotter_article
-- ----------------------------
DROP TABLE IF EXISTS `jotter_article`;
CREATE TABLE `jotter_article` (
  `id` int NOT NULL AUTO_INCREMENT,
  `article_title` varchar(255) DEFAULT NULL,
  `article_content_html` longtext,
  `article_content_md` longtext,
  `article_abstract` varchar(255) DEFAULT NULL,
  `article_cover` varchar(255) DEFAULT NULL,
  `article_date` datetime DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of jotter_article
-- ----------------------------
BEGIN;
INSERT INTO `jotter_article` (`id`, `article_title`, `article_content_html`, `article_content_md`, `article_abstract`, `article_cover`, `article_date`) VALUES (1, '流浪小动物', '<p>爱护小动物，人人有责！</p>\n<pre><code class=\"lang-language\">救助流浪动物，就是帮助我们自己\n</code></pre>\n<p><img src=\"data:image/png;base64,\" alt=\"aa.png\" rel=\"0\" /></p>\n', '爱护小动物，人人有责！\n```language\n救助流浪动物，就是帮助我们自己\n```\n![aa.png](0)', NULL, 'https://ss0.bdstatic.com/70cFuHSh_Q1YnxGkpoWK1HF6hhy/it/u=1977438004,2972925604&fm=26&gp=0.jpg', NULL);
INSERT INTO `jotter_article` (`id`, `article_title`, `article_content_html`, `article_content_md`, `article_abstract`, `article_cover`, `article_date`) VALUES (4, '基本的救助流浪猫的方法', '<div class=\"paragraph\">\r\n						<p class=\"content-l-title\">\r\n							基本的救助流浪猫的方法\r\n						</p>\r\n						<p class=\"content-l-time\">\r\n							发布日期：2014-02-18 22:39:00\r\n						</p>\r\n						<p><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></p>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">基本的救助流浪猫的方法</span></div>\r\n<div style=\"\\&quot;text-indent:\" 21pt\\\"=\"\"><span style=\"\\&quot;font-size:\" large\\\"=\"\">本文来自http://www.salove.org/html/showarticle.asp?id=499，如有侵权，请联系csapa@csapa.org。</span></div>\r\n<div style=\"\\&quot;text-indent:\" 21pt\\\"=\"\"><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">针对流浪猫应注意以下情况：</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">1.因为我们的能力有限，我们应该先救助那些受伤了，生命受到危险的猫咪为先，也因为猫咪受伤了多数没有太大的反抗攻击力，救助难度也少。对于没有伤病在街上溜达的猫咪，我们应该先判断是不是居民散养的，因为现在居民散养猫咪情况是非常多的，散养的猫咪有的会带上防蚤颈圈和宠物颈圈，外表干净毛摸上去比较柔软。我们从外表能大概判断，也可以经过询问附近店铺居民了解。如遇到怀疑散养或走失的，我们应先安置好，拍照为它寻找主人。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">2.猫一般是怕人胆小的，我们可以先轻轻的接近，喂点食物减低它们的防备心。确定是流浪猫的话我们可以：</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">（1）亲人性格温和的，能让人摸和抱，不会一直要逃跑的。 可以带到正规的医院做绝育手术，然后拍照片为它寻找领养。因为它们以前应该是有主人的，容易适应家庭生活适合领养。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">（2）有一定戒备心的，但容易亲人性格温和的。可以带到正规的医院做绝育手术，然后拍照片为它寻找领养。因为它们以前应该是有主人的，但流浪一段时间形成戒备心理，但可以通过调理至适合领养。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">（3）戒备心很强的，不亲人但能捉到的，可以带到正规的医院做绝育手术，然后放会原地进行群护喂养。可能是流浪猫生下的小猫，或从小就流浪，部分可以通过调理到适合领养，如果实在不适合领养只能放回原地群护喂养。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">（4）有攻击性，对人非常凶恶的，尽量捕捉带到正规的医院做绝育手术。然后放会原地进行群护喂养。可能被人伤害或性格凶猛，这类型的猫咪适合绝育后放回原地群护喂养。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">中心提供网络平台为大家发布领养或者救助信息，动物医院绝育和治疗优惠，筹集救助资金等等帮助。详细请浏览网站获得帮助。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">流浪猫参考护理方法：</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">其实只要你家里有一定的空间能把自己养的猫和流浪猫隔离，或者你自己没有养动物的话，其实你可以把流浪猫带回家做简单的护理，很多没有病痛的猫咪经过护理之后就可以为它找领养了，参考方法如下。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">1.先将猫咪固定在一个封闭安全的地方，例如笼子，阳台。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">2.检查猫咪身体有没有外伤，跳蚤寄生虫等。就算猫咪邋遢也不要先急于洗澡。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">3.用适当的容器装好猫粮、水在猫咪附近，可以用纸箱铺垫旧衣服毛巾做临时窝，或者直接在地上用毛巾旧衣服垫着也可以。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">4.跳蚤可以买水剂体外驱虫药去除，注意不要用去蚤颈圈，因为效果不好而且可能有毒性。在猫咪颈背就是头和颈的接驳位置滴就可以。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">5.用热毛巾把猫咪的身体搽干净，然后让猫咪休息，大约隔离3-7天就可以为猫咪找领养了。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">6.各类常见问题处理：</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">(1)猫咪眼睛睁不开，留眼水或眼睛很邋遢？</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">先睇1滴普通眼药水，再用纸巾轻轻擦干净猫咪的眼睛直到眼睛干净明亮即可。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">(2)小猫咪不能排便？</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">用湿的棉签轻轻的擦肛门，就是尾巴下面的位置。大约2-3次猫咪就会排便，如果多天不能排便可以用小儿开塞露挤一点进肛门令猫咪排便。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">(3)简单外伤处理</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">如果猫咪有轻微的外伤例如皮肤破损、掉毛掉皮等，可以用双氧水表面消毒，再用碘酒碘伏进行2次消毒。如果伤口比较大或者深一点，可以消毒后外敷云南白药（药房卖大约几元一小瓶的粉剂）。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">如果猫咪有轻微拉肚子，可以给妈咪爱、思密达（药房有售，大约是20-30元一盒），大约给成猫3分1包、小猫4分1包每次的分量混合肉或者妙鲜包给猫咪吃，大约每天1次。</span></div>\r\n<div><span style=\"\\&quot;font-size:\" large\\\"=\"\">&nbsp;</span></div>\r\n					</div>', '针对流浪猫应注意以下情况：\r\n \r\n1.因为我们的能力有限，我们应该先救助那些受伤了，生命受到危险的猫咪为先，也因为猫咪受伤了多数没有太大的反抗攻击力，救助难度也少', '针对流浪猫应注意以下情况：', 'https://dss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=523074288,809559107&fm=26&gp=0.jpg', '2020-03-19 00:00:00');
COMMIT;

